/* eslint-disable no-undef */
//import flightStatusHome from "../support/pages/FlightStatusHome.page";
import * as flightStatusSteps from "../support/steps/SearchFlightStatus.step";

describe("Flight Status of Eurowings flight for a particular route", () => {

    it("Given I am searching for a flight by route to verify the flight status of current day - Component header verification", () => {
        flightStatusSteps.thenISelectFlightStatusByRouteToVerifyStatusHeader();
    });

    it("Given I am searching for a flight by route to verify the flight Status of current day - verify the components in the flights panel", () => {
        flightStatusSteps.thenISelectFlightStatusByRouteTOVerifyFlightsListed();
    });

    it.skip("Given I am searching for a flight by route to verify the Flight Status of previos day - Verify the Flight status Panel", () => {
        flightStatusSteps.thenISelectFlightStatusByRouteOfPrevDay();
    });

    it.skip("Given I am searching for a flight by route to verify the Flight Status of Next day - Verify the Flight status Panel", () => {
        flightStatusSteps.thenISelectFlightStatusByRouteOfNextDay();
    });

    it.skip("Given I am searching for a flight by flight no to verify the Flight status - Verify the Flight Status Panel", () => {
        flightStatusSteps.thenISelectFlightStatusByFlightNo();
    });

    it.skip("Given Iam searching for a flight and selecting on the dates from the date list - verify the Flight status panel", () => {
        flightStatusSteps.thenISelectFlightStatusByRouteOfPrevDay();
    });

    it.skip("To verify that the Search flight button is disable when the user not selected all the required field values " , () => {
        flightStatusSteps.thenIVerifyThatSearchButtonIsDisabled();
    });
    
});

